import React from "react";
import Table from "./DescTable";
import Collegelogo from "./Collegelogo";
export default function Homeright() {
const [logged,setLogged]=React.useState(); 
   React.useEffect(()=>{
       fetch("http://127.0.0.1:5000/login").then(response=>response.json()).then(data=>{
      console.log(data)
  });
 },[]); 
 return (
    <div
      style={{
        width: "calc(100vw - 275px)",
        position: "fixed",
        height: "100vh",
        overflow: "hidden"
      }}
    >
      <table style={{ marginTop: "3%" }}>
        <tr>
          <td>
            <Collegelogo />
          </td>
          <td style={{ paddingLeft: "35px", color: "#bc6ff1" }}>
            <h1
              style={{
                marginLeft: "-3%",
                display: "flex",
                justifyContent: "center",
                alignItem: "center",
                color: "#474f85"
              }}
            >{logged}
            </h1>
          </td>
        </tr>
      </table>
      <div
        style={{
          marginLeft: "-5.5%",
          zIndex: "1",
          marginTop: "3.5%",
          marginBottom: "50px"
        }}
      >
        <Table caption="Recently Added Materials" type="home" />
      </div>
    </div>
  );
}
